import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Home = () => {
  const [noticia, setNoticias] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios.get('https://servicodados.ibge.gov.br/api/v3/noticias/?tipo=noticia');
      setNoticias(response.data.noticias);
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Not√≠cias sobre Empreendedorismo</h1>
      <ul>
        {noticia?.map((noticia) => (
          <li key={noticia.id}>
            <h2>{noticia.titulo}</h2>
            <p>{noticia.resumo}</p>
            <a href={noticia.link}>Leia mais</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default Home;
